  true,\n\t\"url\": null,\n\t\"notes\": \"The Industrial Assessment Centers (IAC)
  Database is a collection of all the publicly available data from energy efficiency
  assessments conducted by IACs at small and medium-sized industrial facilities. The
  data includes information beginning in 1981 on the type of facility assessed (size,
  industry, energy usage, etc.) as well as the details of resulting recommendations
  (type, energy & dollars savings etc.). As of 09-20-2012, the IAC database contains
  information on 15,608 assessments and an associated 117,262 recommendations for
  energy efficiency improvements.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
